The Kernel 3.10.0-123.20.1.el7 through 3.10.0-229.14.1.el7 crashes when presented a buggy USB device which requires the usbvision driver. All subsequently published kernel updates crash as well. The configuration descriptor containing the malicious value for bInterfaceNumber causing the crash. Any number but 0 crashes the system. Since, the vulnerable device is a security camera of Cafe heeva, opposite to optp cafe T-Block DHA. We don't have access for the patching. As discussed above, the device may crash because of the malicious value for binterfaceNumber. One of the proposed way of patching is, if we somehow put a condition on the binterfaceNumber that it must be zero and cannot be change. The device may become invulnerable.
The original advisory is available in [2].
The vendor does not plan to fix this vulnerability, as described in their bug report, available in [3].
However, the proposed patched [4] is given as:
Patch:
diff --git a/drivers/media/usb/usbvision/usbvision-video.c b/drivers/media/usb/usbvision/usbvision-video.c
index 3089d64..de9ff3b 100644
---  a/drivers/media/usb/usbvision/usbvision-video.c
+++  b/drivers/media/usb/usbvision/usbvision-video.c
@@ -1470,9 +1470,23 @@ static int usbvision_probe(struct usb_interface *intf,
 
 	if (usbvision_device_data[model].interface >= 0)
 		interface = &dev->actconfig->interface[usbvision_device_data[model].interface]->altsetting[0];
	else if (ifnum < dev->actconfig->desc.bNumInterfaces)
 		interface = &dev->actconfig->interface[ifnum]->altsetting[0];
	else {
		dev_err(&intf->dev, "interface %d is invalid, max is %d\n",
		    ifnum, dev->actconfig->desc.bNumInterfaces - 1);
		ret = -ENODEV;
		goto err_usb;
	}

